(23, 16, 'Lorem Ipsum', 'Lorem Ipsum é simplesmente uma simulação de texto da indústria tipográfica e de impressos', '<p>É um fato conhecido de todos que um leitor se distrairá com o conteúdo de texto legível de uma página quando estiver examinando sua diagramação. A vantagem de usar Lorem Ipsum é que ele tem uma distribuição normal de letras, ao contrário de \"Conteúdo aqui, conteúdo aqui\", fazendo com que ele tenha uma aparência similar a de um texto legível. Muitos softwares de publicação e editores de páginas na internet agora usam Lorem Ipsum como texto-modelo padrão, e uma rápida busca por \'lorem ipsum\' mostra vários websites ainda em sua fase de construção. Várias versões novas surgiram ao longo dos anos, eventualmente por acidente, e às vezes de propósito (injetando humor, e coisas do gênero).</p>\r\n<p>Existem muitas variações disponíveis de passagens de Lorem Ipsum, mas a maioria sofreu algum tipo de alteração, seja por inserção de passagens com humor, ou palavras aleatórias que não parecem nem um pouco convincentes. Se você pretende usar uma passagem de Lorem Ipsum, precisa ter certeza de que não há algo embaraçoso escrito escondido no meio do texto. Todos os geradores de Lorem Ipsum na internet tendem a repetir pedaços predefinidos conforme necessário, fazendo deste o primeiro gerador de Lorem Ipsum autêntico da internet. Ele usa um dicionário com mais de 200 palavras em Latim combinado com um punhado de modelos de estrutura de frases para gerar um Lorem Ipsum com aparência razoável, livre de repetições, inserções de humor, palavras não características, etc.</p>\r\n<p>Ao contrário do que se acredita, Lorem Ipsum não é simplesmente um texto randômico. Com mais de 2000 anos, suas raízes podem ser encontradas em uma obra de literatura latina clássica datada de 45 AC. Richard McClintock, um professor de latim do Hampden-Sydney College na Virginia, pesquisou uma das mais obscuras palavras em latim, consectetur, oriunda de uma passagem de Lorem Ipsum, e, procurando por entre citações da palavra na literatura clássica, descobriu a sua indubitável origem. Lorem Ipsum vem das seções 1.10.32 e 1.10.33 do \"de Finibus Bonorum et Malorum\" (Os Extremos do Bem e do Mal), de Cícero, escrito em 45 AC. Este livro é um tratado de teoria da ética muito popular na época da Renascença. A primeira linha de Lorem Ipsum, \"Lorem Ipsum dolor sit amet...\" vem de uma linha na seção 1.10.32.</p>', '2019-02-21 17:23:39', 1, 4),
(24, 16, 'O que é o IP? Descubra para que serve e qual é seu número', 'O IP (ou Internet Protocol) é uma identificação única para cada computador conectado a uma rede. ', '<p>O IP (ou Internet Protocol) é uma identificação única para cada computador conectado a uma rede. Podemos imaginá-lo como um documento de identificação único, como o CPF, por exemplo. Descobrir este número é bastante fácil e pode ser útil para diversas situações, como veremos neste artigo.</p>\r\n<p>Ao ligar o computador e conectá-lo a uma rede local, o aparelho recebe um endereço IP que é comumente chamado de IP interno. Mas, a partir do momento em que o usuário começa a navegar, ele passa a usar um segundo número, conhecido como IP externo (que pode estar no computador ou no equipamento que dá acesso à internet).</p>', '2019-02-21 05:54:11', NULL, 4),
(27, 16, 'Samsung revela celular dobrável Galaxy Fold; veja preço e especificações', 'Smartphone é anunciado no evento do Galaxy S10. Usuário escolhe entre tela pequena de celular ou tela grande que lembra tablet.', 'A Samsung concretizou nesta tarde uma promessa feita em 2018: de trazer ao mundo o primeiro celular dobrável da marca. Galaxy Fold é o nome do smartphone que se fecha tal qual um livro. Em outras palavras, traz uma tela pequena por padrão, mas pode se converter num produto de display maior e que mais lembra um tablet. O lançamento ocorre nesta quarta-feira (20) junto com a apresentação da linha Galaxy S10. O preço chega perto dos US$ 2.000.\r\n\r\nAinda não se sabe se o Galaxy Fold será vendido no Brasil, muito menos por qual preço. O celular é tido como uma quebra de paradigma, pois sai da mesmice de outros smartphones em formato de barra, com tela grande e bordas finas. Roda sistema Android 9 (Pie) com Samsung One UI e avanços no sistema que detecta os aplicativos abertos numa tela e os replica no segundo display – o recurso se chama App Continuity.\r\n\r\n\r\n\r\nPUBLICIDADE\r\n\r\ninRead invented by Teads\r\nCelular Samsung Galaxy barato: encontre ofertas no Compare TechTudo\r\nCelular dobrável vira tendência em 2019: saiba o que vem por aí\r\nGalaxy Fold é apresentado nos EUA — Foto: Reprodução/TechTudo Galaxy Fold é apresentado nos EUA — Foto: Reprodução/TechTudo\r\nGalaxy Fold é apresentado nos EUA — Foto: Reprodução/TechTudo\r\n\r\nA tela principal tem 7,3 polegadas e painel AMOLED Dinâmico. Quando fechado, ele se torna um dispositivo com tela cover de 4,6 polegadas e painel Super AMOLED. A multitarefa permite rodar até três apps simultaneamente. “Inventamos um sistema de dobradiça que possibilita abrir e fechá-lo”, disse um executivo.\r\n\r\nA ficha técnica inclui memória RAM de 12 GB e armazenamento de 512 GB, com suporte a cartão de memória. São seis câmeras ao todo: três na traseira, duas no centro e uma na parte frontal do aparelho.\r\n\r\nO Galaxy Fold chega às lojas dos Estados Unidos em 26 de abril pelo preço sugerido de US$ 1.980, cerca de R$ 7.365 em conversão direta. São quatro opções de cor: preto, cinza, verde e azul.', '2019-02-21 02:06:28', 1, 4),
(31, 5, 'Prefeito diz acreditar que fechamento da fronteira não impedirá ajuda humanitária', 'Antonio Denarium afirma que fechamento da fronteira cria um \'clima tenso\' na região.', 'O governador de Roraima, Antonio Denarium (PSL), disse nesta quinta-feira (21) acreditar que, embora crie um \"clima tenso\" na região, a decisão do presidente da Venezuela, Nicolás Maduro de fechar a fronteira com o Brasil não impedirá a entrega de alimentos e medicamentos aos cidadãos do país vizinho.\r\n\r\nDenarium deu a declaração depois que o presidente da Venezuela anunciou o fechamento da fronteira com o Brasil a partir das 20h (21h pelo horário brasileiro) desta quinta. Até as 17h, a fronteira permanecia aberta.\r\n\r\nAté a última atualização desta reportagem, não havia manifestação oficial do Brasil sobre a decisão do governo venezuelano de fechar a fronteira. Consultada, a Secretaria de Comunicação da Presidência informou que o assunto é analisado pelo Ministério das Relações Exteriores. Procurado, o ministério não se manifestou.\r\n\r\nO estado de Roraima fica na fronteira com a Venezuela e se tornou nos últimos anos a principal porta de entrada de imigrantes que fogem da crise política, econômica e social que vive o país.\r\n\r\nDenarium está em Brasília, onde discutiu com o governo federal a entrega de ajuda humanitária aos venezuelanos, anunciada pelo Palácio do Planalto na terça-feira (19).\r\n\r\nPara o governador, um dos reflexos do fechamento da fronteira será a entrada de venezuelanos no Brasil por fora dos pontos oficiais de controle.\r\n\r\n“A fronteira é seca. Então, se uma pessoa não quiser passar pela fronteira, onde é o local oficial, passa pelas ‘laterais’. Temos 1.850 quilômetros de fronteira\", disse.\r\n\"Vai é inibir aquelas pessoas que querem entrar de forma legalizada. Elas não vão entrar, vão ficar esperando a fronteira abrir\", declarou.\r\n\r\nO governo brasileiro enviará alimentos e medicamentos até as cidades de Boa Vista e Pacaraima, em Roraima. A intenção é que os produtos sejam retirados no Brasil por venezuelanos, que para isso cruzariam a fronteira em caminhões.\r\n\r\n\"Não vai impedir a distribuição da ajuda humanitária. Acredito que, mesmo que esses gêneros alimentícios e medicamentos estejam em território brasileiro, não teria dificuldades em distribuir isso entre os venezuelanos, mesmo com a fronteira fechada. É atravessar e pegar a ajuda”, disse o governador ao G1.', '2019-02-22 19:33:00', 1, 4),
(32, 18, 'Em entrevista, pai de Neymar defende o filho das críticas: \"Como atleta, ele não é mimado\"', 'Ao programa \"Grande Círculo\", empresário do craque diz que ele não vive em uma bolha', 'Neymar da Silva Santos, o Neymar Pai, foi o entrevistado do mês de fevereiro do programa \"Grande Círculo\", que vai ao ar neste sábado, às 22h30, no SporTV. O responsável pela carreira do jogador mais caro do mundo – por quem o PSG pagou 222 milhões de euros em 2017 – foi sabatinado pelo apresentador Milton Leite e por uma bancada formada por Marcelo Canellas, Mauro Naves, Casagrande, Pedro Bial, Tino Marcos e Marcelo Barreto.\r\n\r\nNeymar falou sobre as críticas que seu filho recebeu durante e depois da Copa do Mundo, defendeu a legalidade das operações que resultaram em processos no Brasil e na Espanha, explicou os motivos que levaram Neymar (o filho) a trocar o Barcelona pelo PSG. E, sobretudo, defendeu seu filho do comentário formulado por Casagrande, para quem Neymar seria \"mimado\".\r\n\r\nNo Grande Círculo, Casagrande e pai de Neymar discutem craque \"mimado\"\r\n\r\n– Quando as coisas são faladas repentinamente, várias vezes, ainda mais por alguém do seu tamanho e de uma emissora como a Globo, isso pode começar a virar uma verdade. Era um momento de você chegar e falar, pô, freia, segura – declarou o pai de Neymar.\r\n\r\nCasagrande então respondeu que havia feito o comentário no programa \"Redação SporTV\", e que outras pessoas e veículos então repercutiram. Neymar pai então continuou:\r\n\r\n– Seu comentário foi muito pessoal, né? Não foi pertinente o comentário. Por mais que você quisesse colocar o Neymar em uma posição de mimado, não era pertinente, você tinha que falar desportivamente. É natural que um filho seja protegido pelos pais. Você mesmo falou o que é a palavra mimado, eu aceito. Se ele é protegido pelos pais, amém. A posição de mimado desportivamente não é nada pertinente. [...] O atleta não é mimado. Não tem treinador passando a mão na cabeça dele. É um dos caras que mais treinam, tem muita responsabilidade profissional, ele está em todos os campeonatos que exigem, não foge de nada. Então a minha resposta... Se eu te falei alguma coisa, desculpa aqui agora, mas não foi pertinente.', '2019-02-22 15:19:40', 1, 6),
(33, 5, 'Ceará terá céu nublado e chuva em todas as regiões no último fim de semana de fevereiro', 'Órgão diz que as precipitações no litoral devem se concentrar entre a madrugada e a manhã. Pela tarde elas ocorrem no interior', 'O Ceará terá céu nublado com chuvas em todas as regiões no último fim de semana de fevereiro, segundo previsão da Fundação Cearense de Meteorologia e Recursos Hídricos (Funceme). De acordo com a Funceme, o Estado tem condições favoráveis nos próximos dias devido à proximidade da Zona de Convergência Intertropical (ZCIT) da costa norte do Nordeste, assim como posicionamento favorável do Vórtice Ciclônico de Altos Níveis (VCAN), cujo centro encontra-se na porção central da nossa região.\r\n\r\n“Os dois sistemas, atuando juntos, indicam condições para precipitações consideráveis em todo o território do Estado nas próximas 96 horas\", afirma o meteorologista Raul Fritz.\r\n\r\nA Funceme diz que as precipitações no litoral devem se concentrar entre a madrugada e a manhã, reduzindo durante o período da tarde, quando o interior do Estado é quem passa a receber maiores acumulados.\r\n\r\nDiante do cenário observado nesta sexta, que indica chances de eventos de chuva mais intensos, a Funceme emitiu avisos para as defesas municipal (de Fortaleza) e estadual. Apesar de a previsão indicada nesta sexta, a Funceme realizará novas análises na tarde desta sexta-feira e na manhã do fim de semana para indicar, se necessário, atualizações.\r\n\r\nTemperaturas médias inalteradas\r\nAs chuvas observadas no Ceará, durante os últimos dias, não alteraram, de forma relevante, as temperaturas no Estado. Em Fortaleza, a temperatura máxima nesta semana foi de 32,2ºC, registrada na última segunda-feira (18), e a mínima, 24°C, nesta quinta. As máximas e mínimas de um intervalo de 24 horas, por exemplo, são registros pontuais, variando ao longo do dia.\r\n\r\n“A variação mais intensa da temperatura depende muito da latitude do lugar. No Ceará, elas [as latitudes] são pequenas, pois estamos próximo da Linha do Equador. Devido a isso, a temperatura do ar não varia muito, mesmo em períodos de chuvas intensas’, explica Fritz.', '2019-02-22 16:27:35', 1, 5),
