INSERT INTO `usuario` (`id`, `nome`, `email`, `img`, `historico`, `user`, `senha`) VALUES
(1, 'Emerson Caralho', 'emso@nada.com', '1', '<p>That\'s right, he\'s gonna be mayor. Whoa, they really cleaned this place up, looks brand new. My insurance, it\'s your car, your insurance should pay for it. Hey, I wanna know who\'s gonna pay for this? I spilled beer all over it when that car smashed into me. Who\'s gonna pay my cleaning bill? Yes, yes, I\'m George, George McFly, and I\'m your density. I mean, I\'m your destiny. It\'s uh, the other end of town, a block past Maple.</p>', 'emersoncu', 'c936c88a8a8a62ebc5491d28870e18bc43f64a28'),
(4, 'Matheus Lima', 'matheus@gmail.com', '1', 'Lorem ipsum aliquam ligula purus et fames nibh, metus lorem imperdiet semper eros sapien nam, sodales potenti urna dictumst cubilia magna. lobortis phasellus curabitur duis tristique ut volutpat justo sagittis elit, ut leo nibh dapibus lacinia vehicula iaculis morbi euismod tempus, at feugiat cras fames habitasse sem laoreet mi. nunc porta quam congue tempor quam praesent aliquam, dolor semper pretium convallis nostra volutpat vitae, sapien odio curabitur sagittis at per. erat rutrum curae venenatis morbi primis lobortis quam aliquam, augue platea porttitor mollis gravida purus augue varius sagittis, potenti risus id massa justo scelerisque non. ', 'matheus', '63982e54a7aeb0d89910475ba6dbd3ca6dd4e5a1'),
(5, 'Quico', 'quico@gmail.com', '1', 'Quico é um garoto de nove anos de idade, bastante paparicado por sua mãe, Dona Florinda, e interpretado por Carlos Villagrán. Adora zombar das crianças, especialmente Chaves e Chiquinha, se exibindo com seus brinquedos e comidas. Quico sempre espera ansiosamente por ganhar uma \"bola quadrada\". Morando no nª 14 com sua mãe, Quico é arrogante e pode ter um gênio tão ruim quanto o de Dona Florinda, que o superprotege, principalmente quando é beliscado pelo vizinho Seu Madruga, que sempre é acusado de qualquer coisa que tenha feito a Quico, mesmo que não seja o culpado ou sequer esteja presente.', 'quico', '63982e54a7aeb0d89910475ba6dbd3ca6dd4e5a1'),
(6, 'chaves', 'chaves@gmail.com', '1', 'Chaves é um órfão de oito anos de idade, interpretado pelo genial Roberto Gómez Bolaños. O garoto diz morar na casa número oito da vila, apesar de sempre entrar em seu barril. É bastante pobre e sempre está atrás de um pouco de comida ou doces dos demais habitantes da vila. Possui os próprios brinquedos, geralmente doações ou caseiros, montados com sucata. Ele demonstra uma certa ingenuidade que beira à ironia e sarcasmo, o que irrita os moradores, principalmente o Seu Madruga. Possui um grande coração, mas é sempre incompreendido por todos. Sempre leva a culpa por tudo o que acontece na vila.', 'chaves', '63982e54a7aeb0d89910475ba6dbd3ca6dd4e5a1');

